export default function Services() {
  return (
    <div className="p-10">
      <h1 className="text-4xl font-bold text-center mb-10">Our Services</h1>
      <div className="grid md:grid-cols-3 gap-8">
        {[
          ['Installation', 'Quick and professional solar panel setup.'],
          ['Maintenance', 'Scheduled cleaning and performance checks.'],
          ['Consultation', 'Expert advice on solar system planning.']
        ].map(([title, desc], idx) => (
          <div key={idx} className="bg-white p-6 shadow rounded">
            <h3 className="text-xl font-bold mb-2">{title}</h3>
            <p className="text-gray-700">{desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
